import React from 'react';
// Font Awesome
import '../FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
function Header(){
    return(
        <div className="background-header"> 
            <div className="container container-header">
                    <a href="/" className="container-logo">
                        <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo"></img>
                    </a>
                    <ul className="container-navbar">
                        <li><a href="/" className="container-navbar-link">HOME</a></li>
                        <li><a href="/" className="container-navbar-link">ITEM  <FontAwesomeIcon icon="angle-down"/></a></li>
                        <li><a href="/" className="container-navbar-link">PET</a></li>
                    </ul>
                    <div className="container-auth">
                        <a href="/"className="container-auth-link"><FontAwesomeIcon icon="user-circle"/> Login/Register</a>
                        <a href="/"className="container-auth-link"> <FontAwesomeIcon icon="shopping-cart"/></a>
                    </div>     
            </div>
        </div>
    )
};
export default Header;
